import React from 'react';
import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";
import Login from './components/login';

function App() {
  return(
    <BrowserRouter>
        <Route component = { Login }  path="/" exact />
    </BrowserRouter>
)
}

export default App;
